  [],\n\t\"revision_timestamp\": \"2016-02-22T19:26:16.155219\",\n\t\"name\": \"southeast-fishery-independent-survey-pc1402\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Southeast Fishery-Independent Survey
  (SEFIS) was created by the National Marine Fisheries Service in 2010 and operates
  out of the NOAA Beaufort Laboratory. The survey conducts fishery-independent sampling
  and related applied research, focusing on the assessment of spatial variability
  in distribution and abundance of marine fish species within the snapper-grouper
  complex, via data collected from fish traps, video cameras, and acoustics.  The
  NOAA ship Pisces departed Morehead city on 5 July 2014 for a SEFIS research cruise
  in continental shelf and shelf-break waters off the southeastern U.S.  During this
  survey, 227 sq km of multibeam data were collected from 48 discrete areas  between
  33.5 Deg N and 35.0 Deg N.  A total of 391 concomitant trap-camera samples were
  collected.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
